import { useState } from 'react'
import { salaryData } from './HardSalaryData'
import SalaryCards from "./SalaryCards";
import {
  useQuery,
  gql
} from "@apollo/client";

const GET_POSTS = gql`
    query {
      posts {
        id
        company
        salary
        previousEducation
        devTitle
        state
        jobHuntDuration
        gender
        age
        yearsOfExperience
      }
    }
`;
console.log(salaryData)


function APICalls() {

  const { loading, error, data } = useQuery(GET_POSTS);
  // const [salaries, setSalaries] = useState([])

  if (loading) return 'Loading...';
  if (error) return `Error! ${error.message}`;

  return (
    <div name="posts">
      <SalaryCards posts={data}/>
    </div>
  );
}
export default APICalls


